import streamlit as st
import html
import base64

st.set_page_config(page_title="HydroStar Signature Builder", page_icon="✉️", layout="centered")
st.title("HydroStar Email Signature Builder")

# Load images as base64
LOGO_DATA_URI = """data:image/png;base64,"""
BANNER_DATA_URI = """data:image/png;base64,"""

# ============================================
# EASY CUSTOMIZATION SETTINGS - CHANGE THESE!
# ============================================

# FONT SETTINGS
FONT_BUMP = 0  # Increase or decrease ALL font sizes by this amount (e.g., 2 = +2px everywhere)
FONT_FAMILY = '"Hind Guntur", sans-serif'  # Specific requested font

# COLOR SETTINGS (use hex codes like #18a44a or color names like "blue")
COLOR_NAME = "#30343c"  # Green color for the person's name
COLOR_LINKS = "#499823"  # Green color for clickable links (email, phone, web)
COLOR_TEXT = "#30343c"  # Dark gray for regular text
COLOR_TITLE = "#333333"  # Color for job title
COLOR_LEGAL = "#30343c"  # Color for the legal disclaimer text

# SIZE SETTINGS
LOGO_SIZE = 120  # Size of the logo in pixels (increased for left-side placement)
BANNER_WIDTH = 600  # Width of the banner in pixels
TABLE_WIDTH = 650  # Fixed table width in px to prevent Outlook auto-resizing
NAME_BOLD = True  # Make name bold? (True or False)
TITLE_BOLD = False  # Make title bold? (True or False)
COMPANY_BOLD = False  # Make company name bold? (True or False)

# SPACING SETTINGS (in pixels)
SPACE_AFTER_NAME = 3  # Space between name and title
SPACE_AFTER_TITLE = 3  # Space between title and company
SPACE_AFTER_COMPANY = 8  # Space between company and contact details
SPACE_BETWEEN_CONTACTS = 2  # Space between each contact line
SPACE_BEFORE_ADDRESS = 8  # Space before the address lines
SPACE_BEFORE_BANNER = 15  # Space before the banner
SPACE_BEFORE_LEGAL = 10  # Space before legal disclaimer
SPACE_BETWEEN_LOGO_AND_TEXT = 8  # Horizontal gap between logo and text
LOGO_CELL_WIDTH = LOGO_SIZE + SPACE_BETWEEN_LOGO_AND_TEXT  # Fixed logo column width

# FONT SIZE SETTINGS (these get bumped by FONT_BUMP automatically)
BASE_SIZE_NAME = 22  # Base size for name
BASE_SIZE_TITLE = 14  # Base size for job title
BASE_SIZE_COMPANY = 14  # Base size for company name
BASE_SIZE_CONTACTS = 13  # Base size for contact details
BASE_SIZE_ADDRESS = 13  # Base size for address
BASE_SIZE_LEGAL = 10  # Base size for legal text

# ============================================
# END OF CUSTOMIZATION SETTINGS
# ============================================

def build_signature_html(name, title, mobile, email, web):
    """Build email signature HTML with maximum compatibility"""
    
    # Clean inputs
    name = html.escape(name)
    title = html.escape(title)
    email_escaped = html.escape(email)
    mobile_display = html.escape(mobile)
    
    # Format phone for tel: link
    tel_clean = "+" + "".join(c for c in mobile if c.isdigit() or c == "+")
    
    # Clean website URL
    web_display = html.escape(web.replace("https://", "").replace("http://", "").replace("/", ""))
    web_link = web if web.startswith("http") else f"https://{web}"
    mailto_href = html.escape(f"mailto:{email}")
    web_href = html.escape(web_link)
    
    # Apply font bump to all sizes
    size_name = BASE_SIZE_NAME + FONT_BUMP
    size_title = BASE_SIZE_TITLE + FONT_BUMP
    size_company = BASE_SIZE_COMPANY + FONT_BUMP
    size_contacts = BASE_SIZE_CONTACTS + FONT_BUMP
    size_address = BASE_SIZE_ADDRESS + FONT_BUMP
    size_legal = BASE_SIZE_LEGAL + FONT_BUMP
    
    # Apply bold settings
    name_weight = "bold" if NAME_BOLD else "normal"
    title_weight = "bold" if TITLE_BOLD else "normal"
    company_weight = "bold" if COMPANY_BOLD else "normal"
    
    # Enhanced MSO conditional styles for Outlook - more comprehensive and specific
    MSO_LINK_STYLE = f"""<!--[if mso]>
<style type="text/css">
a {{color: {COLOR_LINKS} !important; text-decoration: none !important;}}
a span {{color: {COLOR_LINKS} !important; text-decoration: none !important;}}
a:link {{color: {COLOR_LINKS} !important; text-decoration: none !important;}}
a:visited {{color: {COLOR_LINKS} !important; text-decoration: none !important;}}
a:hover {{color: {COLOR_LINKS} !important; text-decoration: none !important;}}
a:active {{color: {COLOR_LINKS} !important; text-decoration: none !important;}}
.link-green {{color: {COLOR_LINKS} !important; text-decoration: none !important;}}
.link-green span {{color: {COLOR_LINKS} !important; text-decoration: none !important;}}
</style>
<![endif]-->"""
    
    # Table-based HTML for maximum email client compatibility with enhanced link styling
    return f"""{MSO_LINK_STYLE}<table width="{TABLE_WIDTH}" cellpadding="0" cellspacing="0" border="0" align="left" style="font-family: {FONT_FAMILY}; color: {COLOR_TEXT}; width: {TABLE_WIDTH}px; table-layout: fixed;">
  <tbody>
    <!-- Main content row with logo on left, text on right -->
    <tr>
      <td valign="top" width="{LOGO_CELL_WIDTH}" style="padding-right: {SPACE_BETWEEN_LOGO_AND_TEXT}px;">
        <!-- Logo column -->
        <img src="{LOGO_DATA_URI}" alt="HydroStar" width="{LOGO_SIZE}" height="{LOGO_SIZE}" style="display: block; border: 0;">
      </td>
      <td valign="top">
        <!-- Text content column -->
        <table cellpadding="0" cellspacing="0" border="0">
          <tbody>
            <tr>
              <td style="font-size: {size_name}px; font-weight: {name_weight}; color: {COLOR_NAME}; padding-bottom: {SPACE_AFTER_NAME}px;">
                {name}
              </td>
            </tr>
            <tr>
              <td style="font-size: {size_title}px; font-weight: {title_weight}; color: {COLOR_TITLE}; padding-bottom: {SPACE_AFTER_TITLE}px;">
                {title}
              </td>
            </tr>
            <tr>
              <td style="font-size: {size_company}px; font-weight: {company_weight}; color: {COLOR_TEXT}; padding-bottom: {SPACE_AFTER_COMPANY}px;">
                HydroStar Europe Ltd
              </td>
            </tr>
            <tr>
              <td style="padding-bottom: {SPACE_BEFORE_ADDRESS}px;">
                <table cellpadding="0" cellspacing="0" border="0">
                  <tbody>
                    <tr>
                      <td style="font-size: {size_contacts}px; color: {COLOR_TEXT}; padding-right: 24px;">
                        <a href="{mailto_href}" class="link-green" style="color: {COLOR_LINKS} !important; text-decoration: none !important; text-decoration-color: {COLOR_LINKS} !important;" color="{COLOR_LINKS}"><span style="color: {COLOR_LINKS} !important;">{email_escaped}</span></a>
                      </td>
                      <td style="font-size: {size_contacts}px; color: {COLOR_TEXT};">
                        <strong>Mobile:</strong> <a href="tel:{tel_clean}" class="link-green" style="color: {COLOR_LINKS} !important; text-decoration: none !important; text-decoration-color: {COLOR_LINKS} !important;" color="{COLOR_LINKS}"><span style="color: {COLOR_LINKS} !important;">{mobile_display}</span></a>
                      </td>
                    </tr>
                  </tbody>
                </table>
              </td>
            </tr>
            <tr>
              <td style="font-size: {size_address}px; color: {COLOR_TEXT}; padding-bottom: 2px;">
                <strong>Address:</strong> Quantum House, 18 Old Vicarage Road, Exeter, EX2 9BJ
              </td>
            </tr>
            <tr>
              <td style="font-size: {size_address}px; color: {COLOR_TEXT}; padding-bottom: 2px;">
                <a href="{web_href}" class="link-green" style="color: {COLOR_LINKS} !important; text-decoration: none !important; text-decoration-color: {COLOR_LINKS} !important;" color="{COLOR_LINKS}"><span style="color: {COLOR_LINKS} !important;">{web_display}</span></a>
              </td>
            </tr>
          </tbody>
        </table>
      </td>
    </tr>
    <!-- Banner row spanning full width -->
    <tr>
      <td colspan="2" width="{TABLE_WIDTH}" style="padding-top: {SPACE_BEFORE_BANNER}px; padding-bottom: {SPACE_BEFORE_LEGAL}px;">
        <a href="https://www.hydrostar-eu.com" target="_blank" style="display: block; text-decoration: none;">
          <img src="{BANNER_DATA_URI}" alt="HydroStar - Hydrogen from Every Drop" width="{TABLE_WIDTH}" style="display: block; border: 0; width: {TABLE_WIDTH}px; height: auto;">
        </a>
      </td>
    </tr>
    <!-- Legal disclaimer row spanning full width -->
    <tr>
      <td colspan="2" style="font-size: {size_legal}px; color: {COLOR_LEGAL}; line-height: {size_legal + 4}px; padding-top: {SPACE_BEFORE_LEGAL}px;">
        This email and any attachments are confidential and intended solely for the use of the individual or entity to whom they are addressed. If you have received this email in error, please notify the sender immediately and delete it from your system. Any unauthorized use, disclosure, or copying of this communication is strictly prohibited. Thank you for understanding. HydroStar Europe Ltd.
      </td>
    </tr>
  </tbody>
</table>"""

# Form for user details
with st.form("signature_form"):
    col1, col2 = st.columns(2)
    
    with col1:
        name = st.text_input("Full Name", placeholder="e.g. Ahmed Abdalla")
        title = st.text_input("Job Title", placeholder="e.g. Research Associate")
        mobile = st.text_input("Mobile", placeholder="e.g. 07377157782")
    
    with col2:
        email = st.text_input("Email", placeholder="e.g. ahmed@hydrostar-uk.com")
        website = st.text_input("Website", value="www.hydrostar-eu.com")
    
    submitted = st.form_submit_button("Generate Signature", type="primary", use_container_width=True)

if submitted:
    # Check if images are loaded properly
    missing_images = []
    if not LOGO_DATA_URI or LOGO_DATA_URI.endswith("YOUR_LOGO_BASE64_HERE"):
        missing_images.append("logo.png")
    if not BANNER_DATA_URI or BANNER_DATA_URI.endswith("YOUR_BANNER_BASE64_HERE"):
        missing_images.append("banner.png")
    
    if missing_images:
        st.error(f"Please ensure the following files are in your folder: {', '.join(missing_images)}")
        st.info("If the files exist but aren't loading, you may need to paste their base64 data directly in the code.")
    elif not name or not title or not mobile or not email:
        st.error("Please fill in all fields before generating the signature.")
    else:
        signature_html = build_signature_html(name, title, mobile, email, website)
        
        st.success("Signature ready! Copy it below and paste into Outlook.")
        st.markdown("---")
        
        # Simple copyable signature with improved styling (with properly escaped braces for f-string)
        signature_copy_widget = f"""
        <style>
        :root {{
            color-scheme: light;
        }}
        body {{
            margin: 0;
            font-family: 'Segoe UI', 'Helvetica Neue', Arial, sans-serif;
            background: transparent;
        }}
        #preview-shell {{
            max-width: 940px;
            margin: 0 auto;
            padding: 0 20px 32px;
        }}
        .card {{
            background: #f5f6fa;
            border-radius: 24px;
            padding: 32px;
            box-shadow: 0 28px 65px rgba(9, 24, 48, 0.35);
            border: 1px solid rgba(15, 29, 39, 0.08);
        }}
        .card-title {{
            font-size: 22px;
            font-weight: 650;
            color: #0f1d27;
            letter-spacing: 0.08em;
            margin-bottom: 18px;
        }}
        #signature-shell {{
            background-color: #ffffff;
            padding: 30px;
            border-radius: 18px;
            border: 1px solid #e1e3e6;
            margin-bottom: 24px;
        }}
        #signature-scroll {{
            overflow-x: auto;
            -webkit-overflow-scrolling: touch;
        }}
        #signature {{
            display: inline-block;
            background-color: white;
            width: fit-content;
            min-width: 650px;
        }}
        #signature table,
        #signature td {{
            background-color: white !important;
        }}
        #signature img {{
            height: auto;
            display: block;
            max-width: none;
        }}
        #copy-button {{
            background: linear-gradient(130deg, #19b24f 0%, #12803a 100%);
            color: #fff;
            border: none;
            padding: 16px 32px;
            font-size: 18px;
            font-weight: 700;
            border-radius: 999px;
            cursor: pointer;
            width: 100%;
            transition: transform 0.2s ease, box-shadow 0.2s ease;
            box-shadow: 0 12px 24px rgba(25, 178, 79, 0.35);
            letter-spacing: 0.08em;
        }}
        #copy-button:hover {{
            transform: translateY(-2px);
            box-shadow: 0 16px 32px rgba(25, 178, 79, 0.35);
        }}
        #copy-button:active {{
            transform: translateY(0);
        }}
        #copy-status {{
            margin-top: 14px;
            text-align: center;
            padding: 12px 14px;
            border-radius: 10px;
            font-size: 15px;
            font-weight: 600;
            min-height: 44px;
        }}
        .helper-text {{
            margin-top: 12px;
            font-size: 14px;
            color: #5d6470;
            text-align: center;
        }}
        @media (max-width: 640px) {{
            .card {{
                padding: 22px;
                border-radius: 18px;
            }}
            #signature-shell {{
                padding: 18px;
            }}
            #signature {{
                min-width: auto;
                width: 100%;
            }}
            #signature img {{
                max-width: 100%;
            }}
        }}
        </style>

        <div id="preview-shell">
          <div class="card">
            <div class="card-title">Signature Preview</div>
            <div id="signature-shell" onclick="selectSignature()" title="Click to select signature">
              <div id="signature-scroll">
                <div id="signature">
                    {signature_html}
                </div>
              </div>
            </div>
            <button id="copy-button" onclick="copySignature(event)">COPY SIGNATURE</button>
            <div id="copy-status"></div>
            <p class="helper-text">Copy, then paste the signature directly into Outlook.</p>
          </div>
        </div>
        
        <script>
        function selectSignature() {{
            const range = document.createRange();
            range.selectNodeContents(document.getElementById('signature'));
            const selection = window.getSelection();
            selection.removeAllRanges();
            selection.addRange(range);
        }}
        function copySignature(event) {{
            const sig = document.getElementById('signature');
            const statusDiv = document.getElementById('copy-status');
            const button = document.getElementById('copy-button');
            const range = document.createRange();
            range.selectNodeContents(sig);
            const selection = window.getSelection();
            selection.removeAllRanges();
            selection.addRange(range);
            try {{
                document.execCommand('copy');
                selection.removeAllRanges();
                button.style.background = '#118339';
                button.innerHTML = 'COPIED';
                statusDiv.style.backgroundColor = '#d4edda';
                statusDiv.style.color = '#155724';
                statusDiv.style.border = '1px solid #c3e6cb';
                statusDiv.innerHTML = 'Signature copied successfully! Paste it straight into Outlook.';
                setTimeout(() => {{
                    button.style.background = 'linear-gradient(130deg, #19b24f 0%, #12803a 100%)';
                    button.innerHTML = 'COPY SIGNATURE';
                    statusDiv.innerHTML = '';
                    statusDiv.style.backgroundColor = 'transparent';
                    statusDiv.style.border = 'none';
                }}, 3000);
            }} catch (err) {{
                statusDiv.style.backgroundColor = '#f8d7da';
                statusDiv.style.color = '#721c24';
                statusDiv.style.border = '1px solid #f5c6cb';
                statusDiv.innerHTML = 'Copy failed. Select the signature manually and use Ctrl+C / Cmd+C.';
            }}
        }}
        </script>
        """
        
        # Adjusted height so the iframe keeps status messaging fully visible
        st.components.v1.html(signature_copy_widget, height=720)
        
        # Additional instructions
        with st.expander("How to add this signature to Outlook"):
            st.markdown("""
            1. Click the **COPY SIGNATURE** button above
            2. Open Outlook and go to **File → Options → Mail → Signatures**
            3. Click **New** to create a new signature
            4. Name your signature (e.g., "HydroStar 2025")
            5. In the signature editor, press **Ctrl+V** to paste
            6. Click **OK** to save
            7. Set as your default signature for new emails and/or replies
            """)
